  `server_signature` text CHARACTER SET utf8 COLLATE utf8_general_ci NULL COMMENT '服务端交易签名',
  `signature` text CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL COMMENT '用户交易签名',
  `deleted` tinyint(0) UNSIGNED NULL DEFAULT 0 COMMENT '逻辑删除',
