  INDEX `transaction_ibfk_2`(`to_account`) USING BTREE,
  INDEX `transaction_ibfk_1`(`from_account`) USING BTREE
) ENGINE = InnoDB AUTO_INCREMENT = 140 CHARACTER SET = utf8 COLLATE = utf8_general_ci COMMENT = '交易记录表' ROW_FORMAT = Dynamic;

